import {useState} from 'react'
import Nav from "../components/Nav";

const OnBoarding = () => {
    return (
        <>
            <Nav
                minimal={true}
                setShowModal={() => {
                }}
                showModal={false}
            >
            </Nav>
            <div className="onboarding">
                <h2>Создание аккаунта</h2>
                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor="first_name">Имя</label>
                        <input
                            id="firsr_name"
                            type="text"
                            name="first_name"
                            placeholder="Имя"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        <label>Дата рождения</label>
                        <div className="multiple-input-container">
                            <label htmlFor="db_day">День</label>
                            <input
                                id="db_day"
                                type="text"
                                name="db_day"
                                placeholder="ДД"
                                required={true}
                                value={""}
                                onChange={handleChange}
                            />
                            <label htmlFor="db_month">Месяц</label>
                            <input
                                id="db_month"
                                type="text"
                                name="db_month"
                                placeholder="ММ"
                                required={true}
                                value={""}
                                onChange={handleChange}
                            />
                            <label htmlFor="db_year">День</label>
                            <input
                                id="db_year"
                                type="text"
                                name="db_year"
                                placeholder="ГГГГ"
                                required={true}
                                value={""}
                                onChange={handleChange}
                            />
                        </div>
                        <label>Пол</label>
                        <div className="multiple-input-container">
                            <input
                                id="man-gender-identity"
                                type="radio"
                                name="gender_identity"
                                required={true}
                                value={"man"}
                                onChange={handleChange}
                            />
                            <input
                                id="woman-gender-identity"
                                type="radio"
                                name="gender_identity"
                                required={true}
                                value={""}
                                onChange={handleChange}
                            />
                        </div>
                    </section>
                </form>
            </div>
        </>
    )
}

export default OnBoarding
